import{_ as e,c as a,o as t,ab as o}from"./chunks/framework.CUflZczI.js";const f=JSON.parse('{"title":"기체","description":"","frontmatter":{},"headers":[],"relativePath":"ko/dev_airframes/index.md","filePath":"ko/dev_airframes/index.md"}'),r={name:"ko/dev_airframes/index.md"},n=o('<h1 id="기체" tabindex="-1">기체 <a class="header-anchor" href="#기체" aria-label="Permalink to &quot;기체&quot;">​</a></h1><p>PX4 has a flexible <a href="./../concept/control_allocation.html">control allocation system</a> that allows it to support almost any imaginable vehicle type/frame through a single codebase:</p><ul><li><strong>고정익:</strong> 일반 비행기, 비행 날개, 역 V 꼬리 비행기 등</li><li><strong>멀티콥터:</strong> 다양한 형태의 헬리콥터, 트리콥터, 쿼드콥터, 헥사로터, 12개 로봇 등</li><li><strong>VTOL:</strong> 테일시터, 테일로터 및 QuadPlanes(평면 + 쿼드)를 포함한 VTOL 구성.</li><li><strong>UGV/로버:</strong> 무인 지상 차량에 대한 지원이 추가되어, 수동 및 임무 기반 제어가 가능합니다.</li></ul><p>지원되는 모든 프레임 유형과 모터 목록은 <a href="./../airframes/airframe_reference.html">기체 정의서</a>를 참고하십시오.</p><p>이 섹션에서는 개발 중인 차량에 대한 빌드 로그를 포함하여, 신규 차량에 PX4를 지원하는 개발 정보를 제공합니다.</p><p>:::note PX4는 또한 잠수함, 보트 또는 수륙양용 차량에서 실험용 항공기 및 로켓에 이르기까지 다향한 차량 유형과 일반 로봇 운용에 적합합니다. <em>Let us know</em> if you have a new vehicle or frame-type you want to help support in PX4. :::</p><p>:::note 지원되는 기체 중 일부에 대한 빌드 로그는 <a href="./../airframes/README.html"> 기체/차량 빌드</a>를 참고하십시오. :::</p>',7),s=[n];function i(l,_,c,p,m,d){return t(),a("div",null,s)}const u=e(r,[["render",i]]);export{f as __pageData,u as default};
